using System;\nusing System.Collections.Generic;\nusing System.Linq;\n\nclass Program\n{\n    static void Main()\n    {\n        List<string> stringList = new List<string> { "apple", "banana", "orange", "apple", "blueberry", "banana" };\n        \n        // Using LINQ to get unique values\n        var uniqueStrings = stringList.Distinct().ToList();\n        \n        // Output the unique strings\n        foreach (var str in uniqueStrings)\n        {\n            Console.WriteLine(str);\n        }\n    }\n}